import logo from './logo.svg';
import './App.css';
import githubSVG from "./qr-code.svg";

function App() {
  return (
    <div className="">
      <div className="toparea">
        <div className="qrandtext">
        <img className="image" src={githubSVG}/>
        <p className="textbelowqr">Scan for my github link</p>
        </div>
      </div> 

    <div className="container">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
    </div>
  );
}

export default App;
